import React from 'react';
import 'controls.css';

export type ButtonProps = {
  icon: string;
  text: string;
  onClick(): void;
};

const Button = ({ icon, text }: ButtonProps) => {
  const handleClick = () => {};

  return (
    <div className="button" onClick={handleClick}>
      {text}
    </div>
  );
};

export default Button;
